import React from 'react';
import { Swiper, SwiperSlide } from 'swiper/react';

import 'swiper/css';
import 'swiper/css/effect-coverflow';
import 'swiper/css/pagination';
import 'swiper/css/navigation';

import { EffectCoverflow, Pagination, Navigation } from 'swiper';

import slide_image_1 from "../../assets/images/test1.jpg";
import slide_image_2 from "../../assets/images/test2.jpeg";
import slide_image_3 from "../../assets/images/test3.jpeg";
import slide_image_4 from "../../assets/images/test4.jpeg";
import slide_image_5 from "../../assets/images/test5.jpeg";
import slide_image_6 from "../../assets/images/test6.jpeg";
import slide_image_7 from "../../assets/images/test7.png";
import slide_image_8 from "../../assets/images/test7.png";
import slide_image_9 from "../../assets/images/test7.png";

import './Menu.css';

function Menu() {
  return (
    <div className="container1">
    <h1 className="heading1"> Ladurée Menu</h1>
    <Swiper
     effect = { 'coverflow' }
     grabCursor = { true }
     centeredSlides = {true} 
     loop={ true }
    slidesPerView={'auto'}
    coverflowEffect={
    {
          rotate:0,
          stretch:0,
          depth:100,
          modifier:2.5
    }
}
    Pagination = {{el :'.swiper-pagination',clickable:true} }
    Navigation={{
        nextEl: '.swiper-button-next',
        prevEl: '.swiper-button-prev',
        clickable: true,
      }}
    modules={[EffectCoverflow,Pagination,Navigation]}
    className='swiper_container'
    >
        <SwiperSlide>
             <img src={slide_image_1} alt="slide_image_1" />
        </SwiperSlide>
        <SwiperSlide>
             <img src={slide_image_2} alt="slide_image_2" />
        </SwiperSlide>
        <SwiperSlide>
             <img src={slide_image_3} alt="slide_image_3" />
        </SwiperSlide>
        <SwiperSlide>
             <img src={slide_image_4} alt="slide_image_4" />
        </SwiperSlide>
        <SwiperSlide>
             <img src={slide_image_5} alt="slide_image_5" />
        </SwiperSlide>
        <SwiperSlide>
             <img src={slide_image_6} alt="slide_image_6" />
        </SwiperSlide>
        <SwiperSlide>
             <img src={slide_image_7} alt="slide_image_7" />
        </SwiperSlide>
        <SwiperSlide>
             <img src={slide_image_8} alt="slide_image_8" />
        </SwiperSlide>
        <SwiperSlide>
             <img src={slide_image_9} alt="slide_image_9" />
        </SwiperSlide>
        <SwiperSlide>
             <img src={slide_image_4} alt="slide_image_4" />
        </SwiperSlide>

        <div className="slider-controler">
           <div className='swiper-button-prev slider-arrow'>
              <ion-icon name="arrow-back-outline" ></ion-icon>
           </div>
           <div className='swiper-button-next slider-arrow'>
              <ion-icon name="arrow-forward-outline" ></ion-icon>
           </div>
           <div className="swiper-pagination"></div>

        </div>
     </Swiper>
    </div>
  )
}

export default Menu
